import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  onGetStockPrice() {
      // var url = () => {
      //   var ticker = document.getElementById('ticker-input');
      //   if (ticker)
      //     return "http://localhost:8000/" + ticker;
      //   return "http://localhost:8000/"
      // };
      try {
        fetch("https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol=OCDO.L&interval=1min&apikey=VGDQ94ZG26OZZDFP", {
          method: 'GET',
          headers: {
            Accept: 'application/json'
          }
        })
          .then(response => console.log(response))
      } catch {
        console.log('abc')
      }
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <a
            href = "http://localhost:8000"
            target="_blank"
            > Get Today's Stock Price</a>
              <input
                id = "ticker-input"
                type="text"
                placeholder="Enter search ticker..."
              />
              <div>
                <button onClick={this.onGetStockPrice}>Today's Stock Price</button>;
              </div>
        </header>
      </div>
    );
  }

}

export default App;
